import React from "react";
import ChatList from "../Components/ChatList/ChatList";
import GroupList from "../Components/GroupList/GroupList";

const ChatHome = () => {
  return (
    <div className="_main">
      <ChatList />
      <GroupList />
    </div>
  );
};

export default ChatHome;
